import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// import UButton from './utilities/UButton';
import Page from './utilities/Page';
import UTextInput from './UTextInput';

export default () => {
    return (
        <Page>
            <Row>
                <Col>
                    <Row>
                        <UTextInput placeholder='Model Name' label='Model Name'></UTextInput>
                    </Row>
                    <Row>
                        <USelectDropdown placeholder='Model Name' label='Model Name'></USelectDropdown>
                    </Row>
                </Col>
                <Col></Col>
            </Row>
        </Page>
    );
};
